import React, { useState, useEffect } from 'react';
import './ProductInfo.css';

const ProductInfo = () => {
    const [agroProducts, setAgroProducts] = useState([]);
    const [organicProducts, setOrganicProducts] = useState([]);
    const [inorganicProducts, setInorganicProducts] = useState([]);
    const [activeProduct, setActiveProduct] = useState(null);

    useEffect(() => {
        const fetchProducts = async (category, setProducts) => {
            try {
                let response = await fetch(`http://api.shreejiinternationals.in/products/${category}`);
                let data = await response.json();
                setProducts(data);
            } catch (error) {
                console.error(`Error fetching ${category} products:`, error);
            }
        };

        fetchProducts('agrochemical', setAgroProducts);
        fetchProducts('organic', setOrganicProducts);
        fetchProducts('inorganic', setInorganicProducts);
    }, []);

    const toggleProductInfo = (productId) => {
        setActiveProduct(activeProduct === productId ? null : productId);
    };

    const renderProducts = (products) => (
        products.map((product) => (
            <div className="product-container" key={product._id}>
                <div className={`product-item ${activeProduct === product._id ? 'expanded' : ''}`}>
                    <div className="product-title" onClick={() => toggleProductInfo(product._id)}>
                        {product.TechnicalName}
                    </div>
                    {activeProduct === product._id && (
                        <div className="product-info">
                            <table>
                                <tbody>
                                    <tr>
                                        <th>Technical Name</th>
                                        <td>{product.TechnicalName}</td>
                                    </tr>
                                    <tr>
                                        <th>CAS No.</th>
                                        <td>{product.CASno}</td>
                                    </tr>
                                    <tr>
                                        <th>Chemical Structure</th>
                                        <td><img src={product.ChemicalStructure} alt="Chemical Structure" /></td>
                                    </tr>
                                    <tr>
                                        <th>Packing</th>
                                        <td>{product.Packing}</td>
                                    </tr>
                                </tbody>
                            </table>
                        </div>
                    )}
                </div>
            </div>
        ))
    );

    return (
        <div className="product-info-container">
            <header className="product-header">
                <div className="cover-image">
                    <div className="cover-text">
                        <h1>Our Products</h1>
                        <p>Quality Products for Quality Produce</p>
                    </div>
                </div>
            </header>
            <div className="product-section">
                <h2>Agrochemicals</h2>
                <div className="product-list">
                    {renderProducts(agroProducts)}
                </div>
            </div>
            <div className="product-section">
                <h2>Organic</h2>
                <div className="product-list">
                    {renderProducts(organicProducts)}
                </div>
            </div>
            <div className="product-section">
                <h2>Inorganic</h2>
                <div className="product-list">
                    {renderProducts(inorganicProducts)}
                </div>
            </div>
        </div>
    );
};

export default ProductInfo;
